import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import { useState } from "react";
import styles from "./css/CardsCursos.module.css"

function BasicExample() {
  const [cards] = useState([
    {
      id: 1,
      imagem:
        "data:image/jpeg;base64,",
      titulo: "Card 1",
      descricao: "",
      tempo: "1h",
      tipo: "presencial",
      datadeinicio: "01/01/2022",
    },
    {
      id: 2,
      imagem: "data:image/jpeg;base64,",
      titulo: "Card 1",
      descricao: "",
      tempo: "1h",
      tipo: "presencial",
      datadeinicio: "02/02/2023",
    },
    {
      id: 3,
      imagem: "data:image/jpeg;base64,",
      titulo: "Card 1",
      descricao: "",
      tempo: "1h",
      tipo: "presencial",
      datadeinicio: "03/03/2024",
    },
  ]);
  return (
     <div className={styles.Cards}>
      {cards.map((card) => (
         <Card key={card.id} style={{ width: "18rem"}}
          >
          <Card.Img variant="top" src={card.imagem} />
          <Card.Body>
            <Card.Title>{card.titulo}</Card.Title>
            <Card.Text>{card.descricao}</Card.Text>
          </Card.Body>
          <ListGroup className="list-group-flush">
        <ListGroup.Item>{card.tempo}</ListGroup.Item>
        <ListGroup.Item>{card.tipo}</ListGroup.Item>
        <ListGroup.Item>{card.datadeinicio}</ListGroup.Item>
      </ListGroup>
      <Card.Body>
        <Card.Link to="/detalhes/">Detalhes</Card.Link>
      </Card.Body>
        </Card>
      ))}
    </div>
  );
}

export default BasicExample;
